import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import ResponsiveAppBar from './Components/NavBar';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <ResponsiveAppBar   />
    <App />
  </React.StrictMode>
);

